import logo from './logo.svg';
import './App.css';
function Header(props){
  var title=props.title;
  return(
  <header><a href="#"><h1>props.title</h1></a></header>
  )
}

function Nav(){
  return(
    <ol>
      <li><a href="#">html</a></li>
      <li><a href="#">css</a></li>
      <li><a href="#">js</a></li>
    </ol>
  )
}

function Article(){
  return(
    <article>
      <h2>Welcom</h2>
      Hello, WEB
    </article>
  )
}

function App() {
  return (
    <div>
      <Header title="html"></Header>
      <Nav></Nav>
      <Article></Article>
    </div>
  );
}

export default App;
